import React from 'react';
import TableWidget from '../widgets/TableWidget'



function Eventtable(){
    const tableTitle="Event List";
    return (
        <React.Fragment>            
            <TableWidget 
              rows={rows} 
              defaultSort='name'
              columns={columns}
              tableTitle={tableTitle}            
            />
        </React.Fragment>
    );
}

export default Eventtable;
